var currentEditingItem=0;

SavegameEditor={
	Name:'The legend of Zelda: Breath of the wild (Master editor)',
	Filename:'game_data.sav',
	Version:20181202,


	/* Constants */
	Constants:{
		STRING_SIZE:0x80,

		/*						 v1.0    v1.1    v1.2    v1.3    v1.3.3   v1.4     v1.5 */
		FILESIZE:				[896976, 897160, 897112, 907824, 1020648, 1027208, 1027208],
		HEADER:					[0x24e2, 0x24ee, 0x2588, 0x29c0, 0x3ef8,  0x471a,  0x471b],
	},

	Hashes:[],
	HashesTypes:{},
	HashesNames:{},



	/* private functions */
	_toHexInt:function(i){var s=i.toString(16);while(s.length<8)s='0'+s;return '0x'+s},
	_writeBoolean:function(offset,val,arrayPos){if(arrayPos)tempFile.writeInt(offset+8*arrayPos,val?1:0);else tempFile.writeInt(offset,val?1:0)},
	_writeValue:function(offset,val,arrayPos){if(arrayPos)tempFile.writeInt(offset+8*arrayPos,val);else tempFile.writeInt(offset,val)},
	_writeString:function(offset,str){
		for(var i=0; i<16; i++){
			tempFile.writeBytes(offset,[0,0,0,0]);
			var fourBytes=str.substr(i*4, 4);
			for(j=0; j<fourBytes.length; j++){
				tempFile.writeByte(offset+j, fourBytes.charCodeAt(j));
			}
			offset+=8;
		}
	},

	_readString:function(offset){
		var txt='';
		for(var j=0; j<16; j++){
			txt+=tempFile.readString(offset,4);
			offset+=8;
		}
		return txt
	},


	/* check if savegame is valid */
	checkValidSavegame:function(){
		tempFile.littleEndian=false;
		for(var i=0; i<this.Constants.FILESIZE.length; i++){
			if(tempFile.fileSize===this.Constants.FILESIZE[i] && tempFile.readInt(0)===this.Constants.HEADER[i] && tempFile.readInt(4)===0xffffffff){
				setValue('version', 'v1.'+i+'.x (Wii U)');
				return true;
			}
		}
		tempFile.littleEndian=true;
		for(var i=0; i<this.Constants.FILESIZE.length; i++){
			if(tempFile.fileSize===this.Constants.FILESIZE[i] && tempFile.readInt(0)===this.Constants.HEADER[i] && tempFile.readInt(4)===0xffffffff){
				setValue('version', 'v1.'+i+'.x (Switch)');
				return true;
			}
		}
		return false
	},


	preload:function(){
		for(var i=0; i<HASHES.length; i++){
			var hashGroup=HASHES[i];
			for(var j=0; j<hashGroup.hashes.length; j+=2){
				var hashValue=hashGroup.hashes[j];
				var hashId=hashGroup.id?hashGroup.id+hashGroup.hashes[j+1]:hashGroup.hashes[j+1];

				this.HashesNames[hashValue]=hashId;
				this.HashesTypes[hashValue]=hashGroup.type;
			}
		}

		/* import new data from MrCheezy json */
		/*for(prop in TEST){
			var hashValue=parseInt(prop)>>>0;
			if(!this.HashesNames[hashValue]){
				this.HashesTypes[hashValue]=TEST[prop][0];
				this.HashesNames[hashValue]=TEST[prop][1]+' (NEW!)';
			}
		}*/
	},


	/* load function */
	load:function(){
		tempFile.littleEndian=false;
		tempFile.fileName='game_data.sav';

		this.Hashes=[];

		var textarea=document.createElement('textarea');
		document.body.appendChild(textarea);
		var previousHashValue=0;
		for(var i=0x0c; i<tempFile.fileSize-4; i+=8){
			var hashValue=tempFile.readInt(i);
			if(hashValue===previousHashValue)
				continue;
			var hashId=this.HashesNames[hashValue] || '___Unknown: '+this._toHexInt(hashValue);
			var hashType=this.HashesTypes[hashValue] || 's32';
			this.Hashes.push({id:hashId, hash:hashValue, type:hashType, offset:i});
			previousHashValue=hashValue;

			/*if(/ \(NEW!\)/.test(hashId)){
				textarea.value+=this._toHexInt(hashValue)+',\"'+hashId+'\",//'+hashType+'\n';
			}*/
		}
		this.Hashes.sort(function(a,b){
		if(a.id<b.id)return -1;
		if(a.id>b.id)return 1;
		return 0;
		});
		
		empty('the-editor');
		for(var i=0; i<this.Hashes.length; i++){
			var hash=this.Hashes[i];

			if(hash.type==='bool'){
				var input=checkbox(hash.id);
				input.offset=hash.offset+4;
				input.addEventListener('change', setBoolean);
				if(tempFile.readInt(hash.offset+4))
					input.checked=true;
				get('the-editor').appendChild(row(
					[8,4],
					label(input.id,(hash.id + ' ('+ (hash.offset+4).toString(16) +')') ),
					input
				));
			}else if(hash.type==='s32'){
				var input=inputNumber(hash.id, 0, 0xffffffff, tempFile.readInt(hash.offset+4));
				input.offset=hash.offset+4;
				input.addEventListener('change', setS32);
				get('the-editor').appendChild(row(
					[8,4],
					label(input.id,(hash.id + ' ('+ (hash.offset+4).toString(16) +')') ),
					input
				));
			}else if(hash.type==='f32'){
				var input=inputNumber(hash.id, 0, 0xffffffff, tempFile.readFloat32(hash.offset+4));
				input.offset=hash.offset+4;
				input.addEventListener('change', setS32);
				get('the-editor').appendChild(row(
					[8,4],
					label(input.id,(hash.id + ' ('+ (hash.offset+4).toString(16) +')') ),
					input
				));
			}else{
				get('the-editor').appendChild(row(
					[12],
					span(hash.id+' ('+hash.type+') ' + (hash.offset+4).toString(16))
				));
			}
		}
	},

	/* save function */
	save:function(){}
}




function onScroll(){
	var h=document.getElementById('header-top').getBoundingClientRect().height;
	if(window.scrollY>h){
		document.getElementById('header').style.position='fixed';
		document.getElementById('header').style.top='-'+h+'px';
	}else{
		document.getElementById('header').style.position='absolute';
		document.getElementById('header').style.top='0px';
	}
}

window.addEventListener('load',function(){
	window.addEventListener('scroll',onScroll,false);
}, false);


function setBoolean(){
	SavegameEditor._writeBoolean(this.offset, this.checked, 0);
}
function setS32(){
	SavegameEditor._writeValue(this.offset, this.value, 0);
}








